import React from "react";
import "./HabitPage.css";

export const HabitPage = () => {
  return (
    <div className="element">
      <div className="div">
        <div className="overlap">


          <div className="rectangle-2" />

          <div className="rectangle-3" />

          <div className="rectangle-4" />

          <div className="text-wrapper-5">베이글</div>

          <div className="text-wrapper-6">베이글</div>

          <div className="text-wrapper-7">베이글</div>

          <div className="text-wrapper-8">아침</div>

          <div className="text-wrapper-9">점심</div>

          <div className="text-wrapper-10">저녁</div>

          <p className="p">500kcal | 탄: 300g | 단: 300g | 지: 300g</p>

          <p className="text-wrapper-11">
            500kcal | 탄: 300g | 단: 300g | 지: 300g
          </p>

          <p className="text-wrapper-12">
            500kcal | 탄: 300g | 단: 300g | 지: 300g
          </p>
        </div>
      </div>
    </div>
  );
};

export default HabitPage;
